import React from 'react';

const newJSON = [
    {
        name: "Quan jean",
    },
    {
        name: "ABC"
    }
]

const Render = () => {
    return (
        newJSON.map(d => {
            return (
                <div>
                    <h2>{d.name}</h2>
                </div>
            )
        })
    )

}

export default Render
